const storeConfigDefaultState = {
  storeGroups: [],
  storeGroupTableData: [],
  currentStoreGroupTableData: [],
};

export default (state = storeConfigDefaultState, action) => {
  switch (action.type) {
    case 'SET_STORE_GROUPS':
      return {
        ...state,
        storeGroups: action.payload,
      };
    case 'SET_STORE_GROUP_TABLE_DATA':
      return {
        ...state,
        storeGroupTableData: action.payload,
      };
    case 'CURRENT_STORE_GROUP_TABLE_DATA':
      return {
        ...state,
        currentStoreGroupTableData: action.payload,
      };
    default:
      return state;
  }
};
